import React from "react";
import logo from "../assets/img/logo.png";
// import "./Navbar.scss"; // Importar o arquivo de estilos

function Navbar() {
  return (
    <nav className="navbar">
          <div className="navbar__logo">
              
          <img src={logo} alt="logo" />
      </div>
          <span>NexoBiiz</span>
    </nav>
  );
}

export default Navbar;
